import React from 'react';
import  { Link } from "react-router-dom"

const styleUL = {
    listStyle: "none",

}
const styleLi = {
    display: "inline",
    display: "flex",
    justifyContent: "space-between"
}

const Nav = () => {
  return (
    <nav>
        <ul style={styleUL}>
            <Link to='/'><li style={styleLi}>Home</li></Link> 
            <Link to='/impressum'><li style={styleLi}>Impressum</li></Link>
            <Link to='/help'><li style={styleLi}>Help</li></Link>
        </ul>
    </nav>
  );
}

export default Nav;
